import {FooterContainer,LinksContainer,Linkd,HorizontalLine} from '../styled-components/styles';
const Footer = () => {
    return (
      <FooterContainer>
        <LinksContainer>
          <Linkd href="#">Link 1</Linkd>
          <Linkd href="#">Link 2</Linkd>
          <Linkd href="#">Link 3</Linkd>
          <Linkd href="#">Link 4</Linkd>
        </LinksContainer>
        <HorizontalLine />
        <p>&copy; 2023 My Website. All Rights Reserved.</p>
      </FooterContainer>
    );
  };
  
  export default Footer;
